{"title":"Scatter plot","type":"vega","aggs":[],"params":{"spec":"{
  "$schema": "https://vega.github.io/schema/vega/v5.json",
  "description": "Scatter plot with polarity, subjectivity, and prediction",
  "width": 800,
  "height": 600,
  "padding": 50,
  "data": [
    {
      "name": "scatterData",
      "url": {
        "%context%": true,
        "index": "artists_songs",
        "body": {
          "size": 1000, // Adjust the size as per your needs
          "_source": ["subjectivity", "polarity", "prediction"]
        }
      },
      "format": {
        "property": "hits.hits"
      }
    }
  ],
  "scales": [
    {
      "name": "xScale",
      "type": "linear",
      "domain": {"data": "scatterData", "field": "_source.polarity"},
      "range": "width"
    },
    {
      "name": "yScale",
      "type": "linear",
      "domain": {"data": "scatterData", "field": "_source.subjectivity"},
      "range": "height",
      "nice": true
    },
    {
      "name": "colorScale",
      "type": "ordinal",
      "domain": {"data": "scatterData", "field": "_source.prediction"},
      "range": ["#1f77b4", "#ff7f0e", "#2ca02c", "#d62728"]
    }
  ],
  "axes": [
    {"orient": "bottom", "scale": "xScale", "title": "Polarity"},
    {"orient": "left", "scale": "yScale", "title": "Subjectivity"}
  ],
  "marks": [
    {
      "type": "symbol",
      "from": {"data": "scatterData"},
      "encode": {
        "enter": {
          "x": {"scale": "xScale", "field": "_source.polarity"},
          "y": {"scale": "yScale", "field": "_source.subjectivity"},
          "fill": {"scale": "colorScale", "field": "_source.prediction"},
          "size": {"value": 50},
          "tooltip": {"signal": "{'Polarity': datum._source.polarity, 'Subjectivity': datum._source.subjectivity, 'Prediction': datum._source.prediction}"},
          "shape": {"value": "circle"}
        }
      }
    }
  ],
  "legends": [
    {
      "title": "Prediction",
      "fill": "colorScale",
      "orient": "right"
    }
  ]
}"}}
